import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import logo from '../images/logo.png';
import '../css/KM.css'
import Card from 'react-bootstrap/Card';

const info = [
    {
        titel: "Klubbmästare",
        namn: "Oliver Jensen",
        img: null
    },
    {
        titel: "Vice Klubbmästare",
        namn: "Johan Widmark",
        img: null
    },
    {
        titel: "Pubmästare",
        namn: "Adam Henriksson",
        img: null
    },
    {
        titel: "Marsall",
        namn: "",
        img: null
    },
    {
        titel: "Marsall",
        namn: "",
        img: null
    }
];



const KM = React.memo(() => {
    let arr = [];
    arr[0] = [];
    arr[1] = [];
    arr[2] = [];

    info.forEach((person, i) => {
        if (i<3)
            arr[0].push(person);
        else if (i<6)
            arr[1].push(person);
        else if (1<9)
            arr[2].push(person);
    });

    const content = arr.map((list, i) => {
        const innerContent = list.map((person, i) => {
            return (
                <Col sm key={"col_"+i}>
                    <Card bg="dark">
                        <Card.Header>{ person.title }</Card.Header>
                        <Card.Body>
                            <Card.Img src={logo}/>
                            <Card.Title>{ person.name }</Card.Title>
                        </Card.Body>
                    </Card>
                </Col>
            )
        });

        return (
            <Row key={"row"+i}>
                { innerContent }
            </Row>
        )

    });

    return(
        <Container className="wide">
            { content }
        </Container>
    )
});


export default KM;
